import { LoginError } from './Types';

type State = ReadonlyArray<LoginError>;

const loginReducer = {
  state: {} as State,
  reducers: {
    errors: (state: State, payload: ReadonlyArray<LoginError>) => payload,
  },
};

export default loginReducer;
